import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    constructor(props){
        super(props)
        this.state = {
            personData : this.props.list
        }
    }
    

    
    render() {
        const userInfo = this.state.personData;
        
        return (
            <div>
                {
                    userInfo.map((user) => {
                        <div key = {user._id}>
                            <p>{user.name}</p>
                            <p>{user.email}</p>
                            <p>{user.age}</p>
                            <button>X</button>
                        </div>
                    })
                }
                
            </div>
        )
    }
}

export default ListOfPeople
